Property.Value:
BEGIN

	SET NOCOUNT ON;
	SET LOCK_TIMEOUT 1000;
	SET DEADLOCK_PRIORITY HIGH;

	DECLARE @TxnCount		INT				= @@TRANCOUNT;
	DECLARE @TxnActive		VARCHAR(32)		= REPLACE(CONVERT(VARCHAR(36), NEWID(), 0), '-', '');
	DECLARE @ErrorCode		INT				= 0;

	IF (@TxnCount = 0) BEGIN TRANSACTION @TxnActive ELSE SAVE TRANSACTION @TxnActive;
	BEGIN TRY
	-----------------------------------------------------------------------------------------------

		INSERT INTO [track].[SsisLogDetail]
		(
			[Event],
			[Computer],
			[Operator],
			[Source],
			[SourceId],
			[ExecutionId],
			[EventBeg],
			[EventEnd],
			[DataCode],
			[DataBytes],
			[Message]
		)
		VALUES
		(
			@event,
			@computer,
			@operator,
			@source,
			@sourceid,
			@executionid,
			@starttime,
			@endtime,
			@datacode,
			@databytes,
			@message
		);

	-----------------------------------------------------------------------------------------------
	IF (@TxnCount = 0) COMMIT TRANSACTION @TxnActive ELSE SAVE TRANSACTION @TxnActive;
	END TRY
	BEGIN CATCH

		SET @ErrorCode = @@ERROR;

		IF (XACT_STATE() = -1) ROLLBACK	TRANSACTION	@TxnActive;
		IF (XACT_STATE() =  1) COMMIT	TRANSACTION	@TxnActive;

		THROW;

		RETURN @ErrorCode;

	END CATCH;

	RETURN @ErrorCode;

END;

CREATE PROCEDURE [dbo].[sp_ssis_addlogentry]
(
	@event			SYSNAME,
	@computer		NVARCHAR(128),
	@operator		NVARCHAR(128),
	@source			NVARCHAR(1024),
	@sourceid		UNIQUEIDENTIFIER,
	@executionid	UNIQUEIDENTIFIER,
	@starttime		DATETIME2,
	@endtime		DATETIME2,
	@datacode		INT,
	@databytes		IMAGE,
	@message		NVARCHAR(2048)
)
AS

BEGIN
DECLARE @BatchSize BIGINT;
DECLARE @RowCount BIGINT; DECLARE @Ratio FLOAT;
SELECT @RowCount = MAX([p].[rows]), @Ratio = ROUND( ((@TargetRatio * [s].[committed_target_kb]) + ((1.0 - @TargetRatio) * [s].[committed_kb])) / 8.0 / SUM([a].[total_pages]) , 3) FROM sys.sql_expression_dependencies [d] INNER JOIN sys.objects [r] ON ([d].[referencing_id] = [r].[object_id]) AND ([r].[type] = 'P') INNER JOIN sys.objects [o] ON ([d].[referenced_id] = [o].[object_id]) AND ([o].[is_ms_shipped] = 0) INNER JOIN sys.indexes [i] ON ([o].[object_id] = [i].[object_id]) AND ([i].[is_primary_key] = 1) INNER JOIN sys.partitions [p] ON ([i].[object_id] = [p].[object_id]) AND ([i].[index_id] = [p].[index_id]) INNER JOIN sys.allocation_units [a] ON ([p].[partition_id] = [a].[container_id]) CROSS JOIN sys.dm_os_sys_info [s] WHERE ([d].[referencing_id] = @ObjectId) AND NOT ( ([o].[name] = LEFT([r].[name], LEN([o].[name]))) AND ([o].[schema_id] = [r].[schema_id]) ) GROUP BY [s].[committed_kb], [s].[committed_target_kb];
SET @BatchSize = CEILING(@Rowcount * CASE WHEN ((@Ratio - 1.0) > (1.0 - @MemoryThreshold)) THEN 1.0 ELSE CASE WHEN (@Ratio < @MemoryThreshold) THEN @Ratio ELSE @MemoryThreshold END END)
RETURN @BatchSize;
END;

CREATE FUNCTION [track].[BatchSize]
(
	@ObjectId			INT,
	@MemoryThreshold	FLOAT	= 0.85,
	@TargetRatio		FLOAT	= 1.0
)
RETURNS BIGINT
WITH RETURNS NULL ON NULL INPUT
AS

BEGIN

	SET NOCOUNT ON;
	SET LOCK_TIMEOUT 100;
	SET DEADLOCK_PRIORITY HIGH;

	DECLARE @TxnCount		INT				= @@TRANCOUNT;
	DECLARE @TxnActive		VARCHAR(32)		= REPLACE(CONVERT(VARCHAR(36), NEWID(), 0), '-', '');
	DECLARE @TxnId			NUMERIC(18, 0)	= NULL;

	IF (@TxnCount = 0) BEGIN TRANSACTION @TxnActive ELSE SAVE TRANSACTION @TxnActive;
	BEGIN TRY
	-----------------------------------------------------------------------------------------------

	DELETE FROM	[track].[ProcedureLogOrphans]	WHERE (1=0);
	DELETE FROM	[track].[ProcedureLogErrors]	WHERE (1=0);
	DELETE FROM	[track].[ProcedureLogEnd]		WHERE (1=0);
	DELETE FROM	[track].[ProcedureLogBegin]		WHERE (1=0);

	-----------------------------------------------------------------------------------------------
	IF (@TxnCount = 0) COMMIT TRANSACTION @TxnActive ELSE SAVE TRANSACTION @TxnActive;
	END TRY
	BEGIN CATCH

		IF (XACT_STATE() = -1) ROLLBACK	TRANSACTION	@TxnActive;
		IF (XACT_STATE() =  1) COMMIT	TRANSACTION	@TxnActive;

		THROW;

	END CATCH;

	RETURN @TxnId;

END;

BEGIN

	SET NOCOUNT ON;
	SET LOCK_TIMEOUT 100;
	SET DEADLOCK_PRIORITY HIGH;

	DECLARE @TxnCount		INT				= @@TRANCOUNT;
	DECLARE @TxnActive		VARCHAR(32)		= REPLACE(CONVERT(VARCHAR(36), NEWID(), 0), '-', '');
	DECLARE @ErrorCode		INT				= 0;

	DECLARE @TrackingLogId	INT;
	EXECUTE @TrackingLogId	= [track].[Insert_ProcedureLogBegin] @@PROCID;

	IF (@TxnCount = 0) BEGIN TRANSACTION @TxnActive ELSE SAVE TRANSACTION @TxnActive;
	BEGIN TRY
	-----------------------------------------------------------------------------------------------

		DROP TABLE IF EXISTS #TempTable;

		SELECT DB_NAME();

		DECLARE @RandomWait	VARCHAR(8) = CONVERT(VARCHAR(8), DATEADD(SECOND, RAND() * 60 * 10, 0), 108);
		PRINT @RandomWait

		WAITFOR DELAY @RandomWait;

		WAITFOR DELAY '00:00:05';

	-----------------------------------------------------------------------------------------------
	IF (@TxnCount = 0) COMMIT TRANSACTION @TxnActive ELSE SAVE TRANSACTION @TxnActive;
	END TRY
	BEGIN CATCH

		SET @ErrorCode = @@ERROR;

		IF (XACT_STATE() = -1) ROLLBACK	TRANSACTION	@TxnActive;
		IF (XACT_STATE() =  1) COMMIT	TRANSACTION	@TxnActive;

		EXECUTE [track].[Insert_ProcedureLogError] @TrackingLogId;

		THROW;

		RETURN @ErrorCode;

	END CATCH;

	EXECUTE [track].[Insert_ProcedureLogEnd] @TrackingLogId;

	RETURN @ErrorCode;

END;

